      syllabus:
        'A mesa visa destacar a importância da formação especializada em Arquivologia em um cenário marcado por avanços e inovações tecnológicas. Pretende-se enfatizar como os profissionais qualificados em Arquivologia desempenham um papel crucial na gestão e preservação da informação em meio aos desafios do mundo do trabalho contemporâneo. Busca-se também esclarecer as diferenças fundamentais entre a Arquivologia e outras áreas afins, como a Biblioteconomia e incentivar a interação entre os profissionais de Arquivologia e outras áreas correlatas de forma a ressaltar a importância da colaboração interdisciplinar para enfrentar os desafios complexos da inovação e tecnologia no contexto do mundo do trabalho.',
